 health, and mental clarity. Check out our past episodes together to learn more about his practices and health advice: Episode 772 and Episode 521.\\n\\nIn times like now, it is so important to make sure our bodies are healthy and our immune systems are strong. Learn how to take control of your health, strengthen your defenses, and protect yourself from COVID-19 on Episode 935 with the wonderful Dr. Steven Gundry.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/qW8YCvrCjrU\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCb5LwJNEO-5IRsVoA-C0LWDbNvrg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qW8YCvrCjrU\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBqqLogkuJ2_Ljc2YB514N8nEWXTA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qW8YCvrCjrU\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCO4lwI5oZDlRdoQgOFokyqpkgqGw\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qW8YCvrCjrU\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAVQZDZhk--9d2nFiAsgZGcRYNg2w\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/qW8YCvrCjrU\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.7637825,\"allowRatings\":true,\"viewCount\":\"608058\",\"author\":\"Lewis Howes\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"0\",\"endTimeMs\":\"4957000\",\"watermark\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/an\/KsP3v2JeT2hWI_HzkxWiMA\/featured_channel.jpg?v=5ecea4fa\",\"width\":40,\"height\":40}]},\"trackingParams\":\"CHoQ8zciEwj2n6ba8ZzqAhUZFfEFHWYQBd0=\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CHoQ8zciEwj2n6ba8ZzqAhUZFfEFHWYQBd0yAml2\",\"com  balance your all-important gut.\n\nThis is the third time Ive had Dr. Gundry on The School of Greatness, and each time Im inspired by his knowledge and his motivation to help other people learn the truth about food, gut health, and mental clarity. Check out our past episodes together to learn more about his practices and health advice: Episode 772 and Episode 521.\n\nIn times like now, it is so important to make sure our bodies are healthy and our immune systems are strong. Learn how to take control of your health, strengthen your defenses, and protect yourself from COVID-19 on Episode 935 with the wonderful Dr. Steven Gundry."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMIi6Km2vGc6gIVrgfxBR0g9Qx_","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCIuiptrxnOoCFa4H8QUdIPUMfzIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DqW8YCvrCjrU%26continue_action%3DQUFFLUhqbGE2cFdvRlIzQ3p5amFUdUVkUW1oQTdTVTd6QXxBQ3Jtc0tsQngxZWZmdktDc2NNRm1jVUdIWEgwdWtDUzc4dkozYVNuc202V094MXFCSGhqQ0JKRWplNjFVSG41TVpzRXhwN0ZHV3BwOUV6dDlmeDlpQ2hia3NtSUVfYU11RDR6aHk0T2k5RHVyd0NzSEViLU5iQ2dsYWx1SjVhVm5hX1ptV3hvdGRlam52cVdJYldJRDA2cC1PYzZVLUJfVEI0V1pLNkR4dTFDNFdadU11UUg5TGJNN0xrbXRwY3VqdFhUaW1PaFlscDhXNktwWEFoOG1odkhSYlcxMlFxbl me":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"qW8YCvrCjrU","title":"Dr. Gundry Talks CORONAVIRUS And How To STAY HEALTHY! | Lewis Howes","lengthSeconds":"4978","keywords":["lewis howes","lewis howes interview","dr. gundry interview","dr. steven gundry","coronavirus","how to stay healthy","healthy foods","how to live longer","health interview","inspiration","motivation","inspirational video","motivational","motivational speech","wealth","school of greatness","health theory","success","success interview","how to boost your immune system","health advice","foods to eat","gut health","microbiome","coronavirus health advice","motivational videos","gundry md","the dr gundry podcast"],"channelId":"UCKsP3v2JeT2hWI_HzkxWiMA","isOwnerViewing":false,"shortDescription":"Dr. Steven Gundry is a renowned cardiologist, surgeon, medical device inventor, and bestselling author. Although he has performed thousands of heart surgeries in his 40-year career, Dr. Gundrys current focus is empowering people through diet to reverse and prevent ailments. Hes the Director and Founder of the International Heart \u0026 Lung Institute as well as the Center for Restorative Medicine in Palm Springs and Santa Barbara, CA. He helps patients learn how to take control of their weight, health, and energy by using his surprisingly simple diet advice.\n\nHes the New York Times best-selling author of The Plant Paradox, and his latest book is The Longevity Paradox which is all about how we can live long, healthy lives and fight the diseases of aging. He also hosts his own health podcast, The Dr. Gundry Podcast which gives you the tools and information you need to hack your vitality, avoid dangerous health foods, and balance your all-important gut.\n\nThis is the third time Ive had Dr. Gundry on The School of Greatness, and each time Im inspired by his knowledge and his motivation to help other people learn the truth about food, gut health, and mental clarity. Check out o
